var grids = document.getElementsByClassName('craftingGrid')

const spritesheet = 'https://vignette.wikia.nocookie.net/tesseract4/images/5/5e/CraftingSpritesheet.png'

for (var i = 0; i < grids.length; i++) {
	var json = JSON.parse(grids[i].dataset.crafting)
	grids[i].innerHTML = processGrid(json)
}

function processGrid(json) {

	var jarray = json.grid 
	
	var z = new String()
	
	for (var col = 0; col < json.columns; col++) {
		z += '<tr class="cgrid">'
		for (var row = 0; row < json.rows; row++) {
			z += '<td class="cgrid">%subst</td>'
		}
		z += '</td>'
	}
	
	var cxtemplate = '<div class="insertedGrid"> <table class="cgrid">' + z + '</table> </div>'

	const baseUrl = ""

	for (var i = 0; i < jarray.length; i++) {
	
		if (typeof jarray[i] == "string" && jarray[i] != "") {
			var reg = /([A-z]*:[0-9]*):([0-9]*)/g
			var index = reg.exec(jarray[i])
			
			if (index == null) {
				jarray[i] = tesseract4.minecraft[jarray[i]]
				jarray[i].number = null
			} else {
				jarray[i] = tesseract4.minecraft[index[1]]
				jarray[i].number = index[2]
			}
		}
	
		if (typeof jarray[i].item == "string") {
		
			jarray[i].ss = tesseract4.locations[jarray[i].item]
		}
	
		if (typeof jarray[i].ss == "object") {
			var addit = "background-position: " + -(jarray[i].ss.x * 32) + "px " + -(jarray[i].ss.y * 32) + "px; background-size: initial; background-origin: border-box;"
			jarray[i].url = spritesheet
		} else { var addit = ""}
	
		if (Object.keys(jarray[i]).length == 0 || jarray[i] == null || jarray[i] == undefined) {
		
			cxtemplate = cxtemplate.replace('%subst', '')
			continue;
		
		}
	
	    var item_ext = jarray[i].url
		var sbst = ' <div class="bigCraft"><div class="craftingImage" style="background-image:url(' + item_ext + '); ' + addit + '"> <span class="craftingImage"> <div class="cgrid-content"><div class="cgrid-tooltip">' + processItem(jarray[i].display) + '</div></div></span></div>' + processItemNumber(jarray[i].number) + '</div>'
		cxtemplate = cxtemplate.replace('%subst', sbst)

	}

	cxtemplate = cxtemplate.replace(new RegExp('%subst', 'g'), '')
	
	return cxtemplate

}

function processItemNumber (x) {
	if (!isNaN(parseInt(x))) {
		var number = parseInt(x)
		
		// 3% if single digit;
		// 12% if mutli-digit
		
		if (number >= 10) {var left = 12} else {var left = 3}
		
		var ret = '<div class="Number" align=right vertical-align=top style="position: relative; top: -12px; left: ' + left + '%; width: 30px; height: 0px; user-select: none; display: block; font-family: minecraftia-regular; font-size: 16px; color: white;">' + number + '</div>'
		return ret
		} else {
		return new String()
		}
}

function processItem (jx) {

	var name = jx.name
	var lore = jx.lore
	
	var ret = new String()
	
	ret += ''
	
	for (var i = 0; i < name.length; i++) {
	
		ret += styleThis(name[i])
	
	}
	
	if (lore != undefined) {
		for (var i = 0; i < lore.length; i++) {
		
			ret += '<br>'
		
			for (var j = 0; j < lore[i].length; j++) {
				
				ret += styleThis(lore[i][j])
			
			}
		
		}
	}
	
	function styleThis(formatJSON) {
	
		var style = new String()
		
		if (formatJSON.bold) {
		
			style += 'font-weight: bold; '
		
		}
		
		if (formatJSON.italics) {
		
			style += 'font-style: italic; '
		
		}
		
		if (formatJSON.colour != null) {
		
			style += 'color: ' + enumerateColour(formatJSON.colour) + '; '
		
		}
		
		if (formatJSON.color != null) {
		
			style += 'color: ' + enumerateColour(formatJSON.color) + '; '
		
		}
		
		function enumerateColour(colour) {
			if (colour.substring(0,10) == "minecraft:") {
				colour = colour.substring(10, colour.length)
				switch (colour) {
				
					case "black":
					return "#000000"
					break;
					
					case "dark_blue":
					return "#0000AA"
					break;
					
					case "dark_green":
					return "#00AA00"
					break;
					
					case "dark_aqua":
					return "#00AAAA"
					break;
					
					case "dark_red":
					return "#AA0000"
					break;
					
					case "dark_purple":
					return "#AA0000"
					break;
									
					case "gold":
					return "#FFAA00"
					break;
					
					case "gray":
					return "#AAAAAA"
					break;
					
					case "dark_gray":
					return "#555555"
					break;
					
					case "blue":
					return "#5555FF"
					break;
					
					case "green":
					return "#55FF55"
					break;
					
					case "aqua":
					return "#55FFFF"
					break;
					
					case "aqua":
					return "#FF5555"
					break;
					
					case "light_purple":
					return "#FF55FF"
					break;
					
					case "yellow":
					return "#FFFF55"
					break;
					
					default:
					return "#FFFFFF"
				
				}
			} else {
				return colour
			}
		
		}
		
		return '<p id="cgIE" style="' + style + '">' + formatJSON.text + '</p>'
	
	}
	
	return ret

}


